import React from "react";
import Paper from "@material-ui/core/Paper";
import Grid from "@material-ui/core/Grid";
import FormControl from "@material-ui/core/FormControl";
import TextField from "@material-ui/core/TextField";
import Typography from "@material-ui/core/Typography";
import Button from "@material-ui/core/Button";

import "./EForm.css";

function EForm() {
  return (
    <Paper elevation={2} className="eform__container">
      <Typography variant="h5" gutterBottom>
        The value of <em>n</em> is: <strong>12</strong>.
      </Typography>
      <Typography variant="h5" gutterBottom>
        The value of <em>&phi;(n)</em> is: <strong>12</strong>.
      </Typography>
      <Typography variant="h5" gutterBottom>
        Enter a public key, <em>e (1 &lt; e &lt; &phi;(n))</em>, such that{" "}
        <em>e</em> and <em>&phi;(n)</em> are relatively prime (The <em>gcd</em>{" "}
        of <em>e</em> and <em>&phi;(n)</em> is 1).
      </Typography>
      <div className="eform__form">
        <FormControl className="eform__formControl" variant="outlined">
          <TextField
            id="outlined-p-value"
            type="number"
            onChange={console.log("Changed P")}
            variant="outlined"
            label="Enter a prime number, P"
          />
        </FormControl>
      </div>
      <Button variant="contained" color="primary" className="eform__button">
        Next
      </Button>
      <Grid container justify="center"></Grid>
    </Paper>
  );
}

export default EForm;
